import logo from "./logo.svg";
import "./App.css";
import Doors from "./components/doors";
import { Router } from "react-router-dom";
import Door from "./components/door";

function App() {
  return (
    <Router>
      <div className="App">
        <Doors />
      </div>
      <Switch>
        <Route exact path="/" component={Doors} />
        <Route path="/door" component={Door} />
      </Switch>
    </Router>
  );
}

export default App;
